import React, { useEffect, useState } from "react";
import { useSelector, useDispatch } from "react-redux";
import { fetchPost } from "../../redux/module/post";
import Post from "./Post";
import PostWrapperStyled from "../styled/mainStyled/PostWrapperStyled";
import axios from "axios";
const Content = () => {
  const [lastPostId, setLastPostId] = useState("");
  useEffect(() => {
    dispatch(fetchPost());
  }, []);
  useEffect(async () => {
    await axios.get("api/v1/posts").then((res) => {
      let lastId = res.data[res.data.length - 1].postsId;
      setLastPostId(lastId);
    });
  }, []);

  const handleClick = () => {
    axios.get(`api/v1/posts/${lastPostId}`).then((res) => {
      console.log(res);
    });
  };

  const posts = useSelector((state) => state.post.posts);
  const dispatch = useDispatch();

  const postList = posts.map((post, index) => (
    <Post key={index} post={post}></Post>
  ));

  return (
    <>
      <PostWrapperStyled>{postList}</PostWrapperStyled>
      <button onClick={handleClick}>click</button>
    </>
  );
};

export default Content;
